ready(()=>{var t=document.querySelectorAll("[data-lazyiframe]");if(t.length){let r=new IntersectionObserver((t,r)=>{t.forEach(t=>{var e;t.isIntersecting&&(e=(t=t.target).getAttribute("data-src"),t.setAttribute("src",e),t.removeAttribute("data-src"),r.unobserve(t))})},{root:null,rootMargin:"0px",threshold:0});t.forEach(t=>{var e=t.getAttribute("data-lazyiframe");t.removeAttribute("data-lazyiframe"),t.setAttribute("data-src",e),r.observe(t)})}});